import React, { useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link } from "react-router-dom";
import { Form, Button, Row, Col, InputGroup } from "react-bootstrap";
import { register } from "../actions/userActions";
import Message from "../components/Message";
import "./login-register.css";

export default function RegisterPage({ history }) {
  const [username, setUsername]             = useState("");
  const [email, setEmail]                   = useState("");
  const [password, setPassword]             = useState("");
  const [confirmPassword, setConfirm]       = useState("");
  const [showPwd, setShowPwd]               = useState(false);
  const [showConfirm, setShowConfirm]       = useState(false);
  const [message, setMessage]               = useState("");

  const dispatch = useDispatch();
  const { loading, error, success } = useSelector((s) => s.userRegisterReducer || {});

  useEffect(() => {
    if (success) history.push("/login");
  }, [success, history]);

  const submitHandler = (e) => {
    e.preventDefault();
    if (password !== confirmPassword) {
      setMessage("Passwords do not match!");
      return;
    }
    setMessage("");
    dispatch(register(username, email, password));
  };

  return (
    <div className="auth-wrap">
      <div className="auth-bg" />

      <Row className="justify-content-md-center auth-row">
        <Col xs={12} md={8} lg={6}>
          <div className="auth-card">
            <div className="auth-brand">
              <img src="/brand/logob.svg" alt="Beauty Shop" />
            </div>

            <h1 className="auth-title">Create your account</h1>
            <p className="auth-sub">Join us and glow with confidence.</p>

            {message && <Message variant="danger">{message}</Message>}
            {error && <Message variant="danger">{error}</Message>}

            <Form onSubmit={submitHandler} className="auth-form">
              <Row>
                <Col md={6}>
                  <Form.Group controlId="username" className="mb-3">
                    <Form.Label>Username</Form.Label>
                    <Form.Control
                      size="lg"
                      type="text"
                      placeholder="Your username"
                      value={username}
                      onChange={(e) => setUsername(e.target.value)}
                      required
                    />
                  </Form.Group>
                </Col>

                <Col md={6}>
                  <Form.Group controlId="email" className="mb-3">
                    <Form.Label>Email</Form.Label>
                    <Form.Control
                      size="lg"
                      type="email"
                      placeholder="name@example.com"
                      value={email}
                      onChange={(e) => setEmail(e.target.value)}
                      required
                    />
                  </Form.Group>
                </Col>
              </Row>

              <Row>
                <Col md={6}>
                  <Form.Group controlId="password" className="mb-3">
                    <Form.Label>Password</Form.Label>
                    <InputGroup size="lg">
                      <Form.Control
                        type={showPwd ? "text" : "password"}
                        placeholder="Create a strong password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        required
                      />
                      <Button
                        variant="outline-secondary"
                        onClick={() => setShowPwd((v) => !v)}
                        className="auth-eye"
                        aria-label={showPwd ? "Hide password" : "Show password"}
                      >
                        <i className={`fas fa-eye${showPwd ? "-slash" : ""}`} />
                      </Button>
                    </InputGroup>
                  </Form.Group>
                </Col>

                <Col md={6}>
                  <Form.Group controlId="passwordConfirm" className="mb-3">
                    <Form.Label>Confirm Password</Form.Label>
                    <InputGroup size="lg">
                      <Form.Control
                        type={showConfirm ? "text" : "password"}
                        placeholder="Re-enter your password"
                        value={confirmPassword}
                        onChange={(e) => setConfirm(e.target.value)}
                        required
                      />
                      <Button
                        variant="outline-secondary"
                        onClick={() => setShowConfirm((v) => !v)}
                        className="auth-eye"
                        aria-label={showConfirm ? "Hide password" : "Show password"}
                      >
                        <i className={`fas fa-eye${showConfirm ? "-slash" : ""}`} />
                      </Button>
                    </InputGroup>
                  </Form.Group>
                </Col>
              </Row>

              <Form.Check
                className="mb-4"
                label={
                  <span>
                    I agree to the{" "}
                    <Link className="auth-link" to="/privacy">Privacy Policy</Link>{" "}
                    and{" "}
                    <Link className="auth-link" to="/cgv">Terms</Link>.
                  </span>
                }
                required
              />

              <Button type="submit" className="auth-submit" size="lg" disabled={loading}>
                {loading ? "Creating…" : "Create Account"}
              </Button>
            </Form>

            <div className="auth-meta">
              Already have an account?{" "}
              <Link to="/login" className="auth-link">Sign in</Link>
            </div>
          </div>
        </Col>
      </Row>
    </div>
  );
}
